import React from 'react';
import '../hojas-de-estilo/Pie de pagina.css'

function Header(props) {
  return (
    <footer className='social-logo'>
      <img src={require(`../Social-logotipos/${props.logo}`)} />
      
    </footer>
  );
}

export default Header;
